function GlamIsInt(strString)
{
  strString = String(strString);
  var strValidChars = "0123456789";
  var strChar;
  var blnResult = true;

  for (i = 0; i < strString.length && blnResult == true; i++)
  {
    strChar = strString.charAt(i);
    blnResult = (strValidChars.indexOf(strChar) == -1 ? false : true);
  }
  return ( blnResult && strString.length > 0 );
}




function GlamGenerateTrackerUrl(info)
{
  var separator = '^';
  var track_str = '';
  track_str = GlamGetAdaptKeyValue('_ge_');
  track_str += separator + ( GlamGetAdaptKeyValue('sid') ? GlamGetAdaptKeyValue('sid') : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('afid') ? GlamGetAdaptKeyValue('afid') : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('dsid') ? GlamGetAdaptKeyValue('dsid') : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('zone') ? GlamGetAdaptKeyValue('zone') : '' );
  track_str += separator + ( GlamGetAdaptKeyValue('sz') ? GlamGetAdaptKeyValue('sz') : 0 );
  track_str += separator + ( info && info.AD_ID ? info.AD_ID : 0 );
  track_str += separator + ( info && info.CREATIVE_ID ? info.CREATIVE_ID : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('cid') ? GlamGetAdaptKeyValue('cid') : -1 );
  track_str += separator + ( GlamGetAdaptKeyValue('did') ? GlamGetAdaptKeyValue('did') : -1 );
  track_str += separator + ( GlamGetAdaptKeyValue('bid') ? GlamGetAdaptKeyValue('bid') : -1 );
  track_str += separator + ( GlamGetAdaptKeyValue('mid') ? GlamGetAdaptKeyValue('mid') : -1 );
  track_str += separator + ( GlamGetAdaptKeyValue('tile') ? GlamGetAdaptKeyValue('tile') : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('seq') ? GlamGetAdaptKeyValue('seq') : 0 );

  var ord= ( GlamGetAdaptKeyValue('ord') ? GlamGetAdaptKeyValue('ord') : 0 );
  if ( !GlamIsInt(ord) )
  {
   var randomnumber=Math.floor(Math.random()*1000000);

   ord= String(GlamCrc32(ord)) + String(randomnumber);
  }

  track_str += separator + ord;
  track_str += separator + ( GlamGetAdaptKeyValue('tt') ? GlamGetAdaptKeyValue('tt') : '' );
  track_str += separator + ( GlamGetAdaptKeyValue('atf') ? GlamGetAdaptKeyValue('atf') : '' );
  track_str += separator + ( GlamGetAdaptKeyValue('flg') ? GlamGetAdaptKeyValue('flg') : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('url') ? GlamGetAdaptKeyValue('url') : '' );
  track_str += separator + ( window.GlamAdaptGetInfo && GlamAdaptGetInfo('country_code') ? GlamAdaptGetInfo('country_code') : 0 );
  track_str += separator + ( window.GlamAdaptGetInfo && GlamAdaptGetInfo('dma') ? GlamAdaptGetInfo('dma') : 0 );
  track_str += separator + ( window.GlamAdaptGetInfo && GlamAdaptGetInfo('region_code') ? GlamAdaptGetInfo('region_code') : 0 );
  track_str += separator + ( window.GlamAdaptGetInfo && GlamAdaptGetInfo('areacode') ? GlamAdaptGetInfo('areacode') : 0 );
  track_str += separator + '' ; // was the zip
  track_str += separator + ( window.GlamAdaptGetInfo && GlamAdaptGetInfo('city') ? GlamAdaptGetInfo('city') : 0 );
  track_str += separator + ( window.GlamAdaptGetInfo && GlamAdaptGetInfo('bw') ? GlamAdaptGetInfo('bw') : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('os') ? GlamGetAdaptKeyValue('os') : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('browser') ? GlamGetAdaptKeyValue('browser') : 0 );
  track_str += separator + ( GlamGetAdaptKeyValue('browser_version') ? GlamGetAdaptKeyValue('browser_version') : 0 );
  track_str += separator + '' ;   // was the ux=
  track_str += separator + ( GlamGetAdaptKeyValue('u') ? GlamGetAdaptKeyValue('u') : '' );
  
  return track_str;
}

